Dinner right out of the river—this little indigenous girl spent the afternoon hunting for worms in the dirt with her brother. And sitting beside her mother as they fished. This catfish is dinner. This girl will grow up knowing the jungle, and the animals. She “goes to school” via satellite link, from far out in the jungle practicing her lessons with a teacher through a computer screen. She could count on one hand the number of times she’s seen a paved road. But has tasted the river nearly every day of her life. 

The vision is to protect it all, the forest, the river, the rain, the people, the animals, the old, the young. It’s all connected. 
