I share the scenes of destruction because out of sight is out of mind. If the world’s rainforests only cover 3% of the landmass of our planet, but contain 50% of the terrestrial biodiversity on this earth, then we have to do everything in our power to protect them. Then we owe it to the millions of life forms that are destroyed every time this happens. We owe it to the indigenous cultures that depends entirely on this ecosystem. We owe it to the future generations — children living in cities all over the globe who’s health will be impacted. But most importantly, I share these images, because I truly believe, and I’ve seen with my own eyes, that hope is not lost. We have the power to stop this from happening. 

Thank you to everyone who  supports @junglekeepers — this year there are millions of wild heartbeats and tens of millions of ancient trees that will be safe because of you.

