I remember when I was a kid and my mom would ask me to put the spider outside — which I would do carefully with a cup and a piece of paper.

Living in the jungle the spiders are a little bigger. Though this one is still small for a tarantula. There isn’t really any “outside” or inside anymore. And besides, these spiders will eat the worse things that could be in our living spaces. So now we use our hands, mostly to make sure no one steps on the giant fluffy spider🕷️ 

